import Navbar from "../components/Navbar"

function Home(){
    return(
        <>
        <Navbar /> 
        <Hero 
        cName="hero"
        heroImg = "data:image/jpeg;base64,"
        title = "Don't wait for a better world; make it."
        text = "Be a part of something greater"
        buttonText ="Donate now"
        url="/"
        btnClass="show"/>
        </>
    )
}

export default Home;
